import React from 'react';
import styled from 'styled-components';

const StringsList = () => {
    const numbers = [1, 2, 3, 4, 5];
    const listItems = numbers.map((number) =>
  <li>{number}</li>
);
  return (
    <ul>
        {listItems}
    </ul>
  );
}

const ListContainer = styled.div`
  width: 483px;
  height: 392px;
  box-shadow: 0px 1px 23px rgba(31, 35, 36, 0.04), 0px 12px 44px rgba(47, 61, 65, 0.16);
  border-radius: 4px;
  color: black;
  text-align: left;
  padding: 31px;
  box-sizing: border-box;
  display: flex;
  flex-direction: column;
  margin: 37px;
`;

export default StringsList
